script: |
  super -f text -I q6342.spq | sort > q6342.out

inputs:
  - name: q6342.spq
    data: |
      SELECT ALL - col1 * + 33 AS col1 FROM tab0 (FORMAT parquet) WHERE + 32 - + col0 - 82 NOT IN ( - - col0 * + - col2, 19 * + col2 );
  - name: tab0

outputs:
  - name: q6342.out
    data: |
      -2673
      -33
      -693
